import {AppBar ,Box,Container,TextField, Paper,Toolbar,Typography, Button} from '@mui/material';

import { makeStyles } from '@mui/styles';






const useStyles = makeStyles(theme=>({
  appbar_text:{
    display:'flex',
    justifyContent:'center',
    color: theme.palette.secondary.main,
    alignItems:'center',
  },
  box:{
    marginTop: theme.spacing(15)
  },
  paper:{
    display:'flex',
    justifyContent:'center',
    alignItems:'center',
    flexDirection:'column',
    paddingBottom: theme.spacing(4) ,
    backgroundColor: theme.palette.primary.main
  },
  login_btn:{
    marginTop: theme.spacing(2),
    display:'flex',
    justifyContent:'center',
    alignItems:'center'
  },
  subheading:{
    marginBottom:theme.spacing(8)
  }

}))


const Profile = () => {
  const classes = useStyles()
  return(
    <>
        <AppBar>
        <Toolbar className={classes.appbar_text}>
            <Typography variant='h4'> <strong>Log In Page</strong> </Typography>
        </Toolbar>
        </AppBar>
        <div className={classes.box}>
          <Box>
            <Container >
              <Paper className={classes.paper}>
              <div className={classes.subheading}>
                <Typography  variant='h5'>Enter Your Credentials</Typography>
                </div>
                <TextField label="Mobile Number"/>
                <br />
                <TextField label="Password"/>
                <div className={classes.login_btn} >
                  <Button  variant='contained'>Log In</Button>
                </div>
              </Paper>
            </Container>
          </Box>
        </div>
     </>
  )
}

export default Profile;
